import React, { useState } from 'react';

export default function ConnectionForm({ onConnect }) {
  const [host, setHost] = useState('');
  const [port, setPort] = useState('1433');
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');

  const submit = e => {
    e.preventDefault();
    onConnect({ host, port: Number(port), username, password });
  };

  return (
    <form onSubmit={submit}>
      <input placeholder="Server host" value={host} onChange={e => setHost(e.target.value)} />
      <input placeholder="Port" value={port} onChange={e => setPort(e.target.value)} />
      <input placeholder="Username" value={username} onChange={e => setUsername(e.target.value)} />
      <input placeholder="Password" type="password" value={password} onChange={e => setPassword(e.target.value)} />
      <button type="submit">Connect</button>
    </form>
  );
}
